import styled from 'styled-components'

const ContainerRoot = styled.div`
margin: 0;
padding: 0;
height:0;
box-sizing: border-box;
`
const Container = styled.div`
 width: 100%;
 margin: 0;
`
const ContainerLogin = styled.div`
 //width: 100%;
 //min-height: 100vw;
 display: flex;
 flex-wrap: wrap;
 align-items: center;
 justify-content: center;
 padding: 15px;
 background: #111;
`
const WrapLogin = styled.div`
 width: 390px;
 background-color: #333
`
const LoginForm = styled.div`
`
const LoginFormTitle = styled.div`
display:block;
padding: 2vw;
font-size: 40px;
color: azure;
line-height:1.2%;
text-align: center;
`

const LogoForm = styled.div`
 width: 50vw;
 display: flex;
 flex-wrap: wrap;
 align-items: center;
 justify-content: center;
`
const WrapInput = styled.div`
 width: 100%;
 position: relative;
 border-bottom: 2px solid #adadad;
 margin-bottom: 37px;
`
const Input = styled.div`
  width: 100%;
  height: 45px;
  padding: 0 5px;
  font-size: 15px;
  color: #fff;
  line-height: 1.2;
  border: none;
  display:block;
  //background: transparent;
  background: gray;
  `

export {
  ContainerRoot,
  Container,
  ContainerLogin,
  WrapLogin,
  LoginForm,
  LoginFormTitle,
  LogoForm,
  WrapInput,
  Input
  
}
